import "./MyBingoPage.css";

function MyBingoPage() {
  return (
    <>
      <p>
        본인에게 해당되는 설명의 칸을 모두 선택한 후 '완료' 버튼을 눌러주세요!
      </p>

      <div>
        <Link to="/mysterybingointro" className="btn">
          완료
        </Link>
      </div>
    </>
  );
}

export default MyBingoPage;
